import React from 'react'
import { NavLink } from 'react-router-dom'
import Projs from './ProjectsApi'

function Proj() {
  return (
   <>
   <div >
    <NavLink exact to="/">
        <button className='btn btn-light'>Seen Enoug!GetBack?</button>
    </NavLink>
    </div>
   {
    
    Projs.map((currEle,index)=>{
        return (
            <div className="card" id='newsId' >
    <img src="..." className="card-img-top" alt="..."/>
            <div className="card-body">
              <h5 className="card-title">{currEle.name} </h5>
              <p className="card-text">{currEle.Description} </p>
              <a href="#" className="btn btn-primary">Visit actual Site</a>
            </div>
          </div>
        )
    })
   }
   
   </>
  )
}

export default Proj
